import React from "react";
import './floating.css';
export default function Floating() {
    return (
        <div className="floating-text-container">
        <div className="floating-text">Close Protection</div>
        <div classN="floating-text">Crowd Management</div>
        <div class="floating-text">Stewarding & Security</div>
        <div class="floating-text">Additional Services</div>
    </div>
    )
}

export  function Floating1() {
    return (
        <div class="floating-text-container">
        <div class="floating-text">Facebook</div>
        <div class="floating-text">Instagram</div>
        <div class="floating-text">Linkedin</div>
        <div class="floating-text">Tiktok</div>
    </div>
    )
}

export  function Floating2() {
    return (
        <div class="floating-text-container">
        <div class="floating-text">Sheffield</div>
        <div class="floating-text">Manchester</div>
        <div class="floating-text">Birmingham</div>
        <div class="floating-text">Leeds</div>
    </div>
    )
}
